import React from 'react';
import myimage from './road.png';

function Report() {
  return (
    <div>
      <h1>Road Network Analysis Report</h1>
      <p>This report presents the analysis of the road network. The analysis includes various network
metrics, distribution of road lengths, and node centralities. The report is generated based on the
road network data for the specified region.</p>
<p>1. Road Network Visualization</p>
